import React from 'react';
import { resetUser } from '../api/userApi';

const AdminPage = () => {
  const userId = 1;

  const handleReset = () => {
    resetUser(userId).then(() => alert("User reset complete."));
  };

  return (
    <div>
      <h1>Admin</h1>
      <button onClick={handleReset}>Reset User</button>
    </div>
  );
};

export default AdminPage;
